import React, { Component } from "react";
import Header from "../components/Header";
import Item from "../components/Item";
import "./styles/Home.css";

import PageLoading from "../components/PageLoading";

export default class Home extends Component {

  state = {
    loading: false,
    error: null,
    data: []
  };

  componentDidMount () {
    this.fetchData()
  }

  fetchData = () => {

  }

  render() {
    if (this.state.loading === true && !this.state.data) {
      return <PageLoading />;
    }

    return (
      <React.Fragment>

        <div className="container-superior">
          <Header />

          <div className="container-fluid row">
            <div className="col-3 item">
              <p> Nuevo humano </p>
            </div>
            <div className="col-3 item">
              <p> Analizar Humano </p>
            </div>
            <div className="col-3 item">
              <p> Con Mutacion </p>
            </div>
            <div className="col-3 item">
              <p> Sin Mutacion </p>
            </div>
          </div>


          <div className="demas row">

            <div className="col-4">
              <Item/>
            </div>
            <div className="col-4">
              <Item/>
            </div>
            <div className="col-4">
              <Item/>
            </div>
            <div className="col-4">
              <Item/>
            </div>
            <div className="col-4">
              <Item/>
            </div>
            <div className="col-4">
              <Item/>
            </div>
            <div className="col-4">
              <Item/>
            </div>
          </div>


        </div>
      </React.Fragment>
    );
  }
}
